import React from 'react';
import {Form,Button} from 'react-bootstrap';

function roles (){
    return(
      
       
        <form className = "role-form">

        <div class="container-fluid bg-secondary">
        
        
        <Form.Group   controlId = "formGridName">
            <Form.Label>Role Name</Form.Label>
            <Form.Control type="name" placeholder="Enter Role Name" />
            <Form.Text className="text-muted">
            </Form.Text>
          </Form.Group>

          <div class="text-center">

            <Button  href="/authority" variant="light" type=" button ">Set Authority</Button> {' '}
          
            <Button variant="info" type=" save "> save </Button>{' '}
          
            <Button variant="warning" type=" cancel " >cancel</Button>

          </div>

            <div class="row">
                <div class= "col-6">col-6</div>
        
                <div class= "col-6" >col-3</div>
            </div>
            
            <div class="row">
                <div class= "col-4">col-6</div>
                <div class= "col-4" >col-3</div>
                <div class= "col-4" >col-3</div>
            </div>
           
        </div>
        </form>

    );
}

export default roles;
